// src/components/Common/Stepper.jsx
import { useState, useEffect, useContext } from "react";
import { CommonContext } from "@ctx/CommonContext";
import DataTableBase from "@c/Common/DataTableBase";

export default function Stepper({ messageId, runState }) {
    const common = useContext(CommonContext);
    if (!common) return null;

    const { progressMap } = common;

    const progressText =
        messageId != null && progressMap && Array.isArray(progressMap[messageId])
            ? progressMap[messageId]
            : [];

    // meta.label / meta.sub[] 기반 steps 생성
    const metaSteps = Array.isArray(progressText)
        ? progressText
              .map((value, idx) => {
                  if (
                      value &&
                      typeof value === "object" &&
                      !Array.isArray(value) &&
                      "label" in value
                  ) {
                      return {
                          index: typeof value.index === "number" ? value.index : idx,
                          label: value.label,
                          sub: Array.isArray(value.sub) ? value.sub : value.sub ? [value.sub] : [],
                      };
                  }
                  return null;
              })
              .filter(Boolean)
        : [];

    // 메타가 없으면 fallback
    const steps =
        metaSteps.length > 0
            ? metaSteps
            : Array.isArray(progressText)
            ? progressText.map((_, idx) => ({
                  index: idx,
                  label: `단계 ${idx + 1}`,
                  sub: [],
              }))
            : [];

    const [currentStep, setCurrentStep] = useState(0);

    useEffect(() => {
        if (!Array.isArray(progressText) || progressText.length === 0) return;

        const filled = progressText.map((v, idx) => (v ? idx : null)).filter((v) => v !== null);

        if (filled.length === 0) return;

        const maxIdx = Math.max(...filled);
        setCurrentStep(maxIdx);
    }, [progressText]);

    const hasValue = (idx) => Boolean(progressText && progressText[idx]);

    const allCompleted = steps.length > 0 ? steps.every((s) => hasValue(s.index)) : false;

    const getStatus = (idx) => {
        if (allCompleted) return hasValue(idx) ? "completed" : "pending";
        if (idx < currentStep && hasValue(idx)) return "completed";
        if (idx === currentStep && hasValue(idx)) return "active";
        return "pending";
    };

    const handleStepClick = (idx) => {
        if (!hasValue(idx)) return;
        setCurrentStep(idx);
    };

    const handleCopy = async (value) => {
        if (!value) return;
        try {
            await navigator.clipboard.writeText(value);
        } catch {}
    };

    const Panel = ({ children }) => (
        <div className="mt-3 rounded-xl border border-slate-200 bg-slate-50 px-4 py-3 text-sm leading-6 text-slate-800">
            {children}
        </div>
    );

    const Indicator = ({ status }) => {
        if (status === "completed")
            return (
                <div className="flex items-center justify-center w-4 h-4 rounded-full bg-slate-900">
                    <div className="w-2 h-2 rounded-full bg-white" />
                </div>
            );

        if (status === "active")
            return (
                <div className="flex items-center justify-center w-4 h-4 rounded-full border-[2px] border-slate-900 bg-white" />
            );

        return (
            <div className="flex items-center justify-center w-4 h-4 rounded-full border border-slate-300 bg-white" />
        );
    };

    const renderPreview = (idx) => {
        const value = progressText?.[idx];
        if (!value) return null;

        // 메타는 프리뷰 없음
        if (typeof value === "object" && "label" in value) return null;

        if (typeof value === "string") {
            return <p className="mt-1 text-xs text-slate-400 truncate">{value.split("\n")[0]}</p>;
        }

        if (typeof value === "object" && value.rows && value.columns) {
            return <p className="mt-1 text-xs text-slate-400">테이블 데이터 준비됨</p>;
        }

        return null;
    };

    const renderContent = (idx) => {
        const value = progressText?.[idx];

        if (
            value &&
            typeof value === "object" &&
            "label" in value &&
            !("rows" in value) &&
            !("columns" in value)
        ) {
            return <Panel>진행 중인 내용이 없습니다.</Panel>;
        }

        if (typeof value === "object" && value.rows && value.columns) {
            return (
                <Panel>
                    <DataTableBase
                        rows={value.rows}
                        columns={value.columns}
                        showPagination={false}
                    />
                </Panel>
            );
        }

        if (idx === 3) {
            return (
                <Panel>
                    <div className="flex justify-between items-center mb-2">
                        <span className="text-xs text-slate-500 font-medium">생성된 SQL</span>
                        {runState && (
                            <button
                                onClick={() => handleCopy(value)}
                                className="text-[11px] border border-slate-300 rounded-full px-2 py-0.5 hover:bg-slate-100"
                            >
                                복사
                            </button>
                        )}
                    </div>
                    <pre className="font-mono text-[13px] whitespace-pre-wrap break-words">
                        {value ?? "진행 중입니다."}
                    </pre>
                </Panel>
            );
        }

        return (
            <Panel>
                <pre className="font-mono text-[13px] whitespace-pre-wrap break-words">
                    {typeof value === "string" ? value : "진행 중입니다."}
                </pre>
            </Panel>
        );
    };

    if (!Array.isArray(progressText) || progressText.length === 0) return null;

    return (
        <div className="w-full rounded-2xl bg-white border border-slate-100 p-5">
            <div className="relative">
                <div className="absolute left-[7px] top-2 bottom-2 w-px bg-slate-200" />

                <div className="space-y-4">
                    {steps.map((step) => {
                        const idx = step.index;
                        const status = getStatus(idx);
                        const isActive = currentStep === idx;
                        const clickable = hasValue(idx);

                        return (
                            <div key={idx} className="relative pl-6">
                                <div className="absolute left-0 top-1">
                                    <Indicator status={status} />
                                </div>

                                <button
                                    type="button"
                                    onClick={() => handleStepClick(idx)}
                                    disabled={!clickable}
                                    className={[
                                        "w-full text-left flex items-center justify-between",
                                        clickable ? "cursor-pointer" : "cursor-default opacity-60",
                                    ].join(" ")}
                                >
                                    <div className="flex-1 min-w-0">
                                        <div
                                            className={[
                                                "text-sm font-medium",
                                                isActive ? "text-slate-900" : "text-slate-600",
                                            ].join(" ")}
                                        >
                                            {step.label}
                                        </div>

                                        {step.sub.length > 0 &&
                                            step.sub.map((line, i) => (
                                                <div
                                                    key={i}
                                                    className="mt-0.5 text-xs text-slate-400"
                                                >
                                                    {line}
                                                </div>
                                            ))}

                                        {renderPreview(idx)}
                                    </div>
                                </button>

                                {isActive && renderContent(idx)}
                            </div>
                        );
                    })}
                </div>
            </div>
        </div>
    );
}
